import styled from 'styled-components';

export const InfoSec = styled.div`

color: #045959;
padding: 160px 0;
background: ${({ lightBg }) => (lightBg ? '#F8F52' : '#173439')};

`;



/* Colors from figma

#F8F5F2 - BG
#045959 - Primary
#F45D48 - Alt accent color maybe
#F41E00 - alt alt accent color


 #173439 - Dark mode bg
#3DD68D  - Dark mode primary


*/
